INSERT INTO `v1_47618ee10d0bbbee7752bbe2ddbd3f53d7546190137ad50a73d3a374beced559` VALUES (1020101, "ようこそ我ら七冠の開発室へ。ここにはアタシたちがレジェンドオブ\nアストルムを開発していた時の記録が残されているらしい。当時の\n極秘データも見れちゃったりするけど、口外禁止で頼むよ、少年。", 10201, 906802, 1020101);
INSERT INTO `v1_47618ee10d0bbbee7752bbe2ddbd3f53d7546190137ad50a73d3a374beced559` VALUES (1021301, "裏世界のプリンセスのみなさまが、きたる『ビストロプリンセス』に備え\nお料理の練習に励まれるようです。『福弾けさせりゃ、一人前』……。\nいったい、どのような反応を意味するお言葉なのでしょうか。", 10213, 105901, 1021301);
INSERT INTO `v1_47618ee10d0bbbee7752bbe2ddbd3f53d7546190137ad50a73d3a374beced559` VALUES (1021302, "『出張ビストロ』オープンの噂は瞬く間に広まり、早くも来訪のご予約が\n殺到しているのだとか。これも、お三方が持つ『カリスマ性』によるもの\nでございますね。主さまもみなさまのお手伝い、頑張ってくださいまし。", 10213, 105901, 1021302);
